import React from "react";

const Order = ({ orderObject }) => {
  return (
    <React.Fragment>
      <div className="order">
        <li className={`order-item ${orderObject.active ? "" : "archived"}`}>
          {orderObject.title}
        </li>
        <li>{(orderObject = "order-item".description)}</li>
        <li>{(orderObject = "order-item".quantity)}</li>
      </div>
    </React.Fragment>
  );
};

export default Order;
